    getDomainName(hostName) {
      let formatedHost = "";
      let splithostName = hostName.split('.');

      if (splithostName.length > 2) {
        formatedHost = hostName.substring(hostName.lastIndexOf(".", hostName.lastIndexOf(".") - 1) + 1);
      } else {
        formatedHost = hostName.split('//')[1];
      }

      return formatedHost;
    }

    getImg() {
      this.loginService.getImg().subscribe(response => {
        document.getElementById('authenticateImage').setAttribute('src', this.getSecureImage(response.img));
        document.getElementById('loginBoxAuthenticateImage').setAttribute('src', this.getSecureImage(response.img));
        this.LoginForm.get('log').setValue(response.log);
      });
    }

    getSecureImage(img) {
      return `data:image/jpeg;base64, ${img}`;
    }

    Login(type) {
      this.submitted = true;

      if (!this.LoginForm.valid) {
        return;
      }

      if (this.isPendingLogin) {
        return;
      }

      this.isPendingLogin = true;
      let data = {
        userName: this.f.userName.value,
        password: this.f.password.value,
        origin: environment.origin,
        firebaseId: "",
        captcha: "0000",
        log: "0000"
      };

      if (type == 0) {
        $('#page_loading').css('display', 'block');
      } else {
        $('#login_loading').css('display', 'block');
      }

      if (this.EMAIL_REGEXP.test(this.f.userName.value)) {
        this.recaptchaV3Service.execute('importantAction').subscribe(token => {
          if (token != null || token != "") {
            this.authService.SignInWithEmail(data, type).then(() => {
              this.submitted = false;
              this.isPendingLogin = false;
            });
          }
        });
      } else {
        this.recaptchaV3Service.execute('importantAction').subscribe(token => {
          if (token != null || token != "") {
            this.loginService.login(data).subscribe(resp => {
              if (resp.errorCode === 0) {
                this.tokenService.setToken(resp.result[0].token);
                this.tokenService.setUserInfo(resp.result[0]);
                this.result = resp.errorDescription;
                this.LoginForm.reset();
                this.closeLoginPop(); // this.router.navigate(['highlight']);
                // window.location.href = "home";

                window.location.href = window.location.origin + window.location.pathname;
              } else {
                if (!resp.errorDescription) {
                  resp.errorDescription = "Username or password is wrong";
                }

                this.result = resp.errorDescription;
              }

              if (type == 0) {
                $('#page_loading').css('display', 'none');
              } else {
                $('#login_loading').css('display', 'none');
              }

              this.submitted = false;
              this.isPendingLogin = false;
            }, err => {
              this.submitted = false;
              this.isPendingLogin = false;
            });
          }
        });
      }
    }

